import React from 'react';

import ProgressBar from './ProgressBar';

const UserList=(props)=>{
    return(
        <div>
            <ProgressBar/>
            <h4>Female Users</h4>
            <h4>Male Users</h4>
        </div>
    )
}

export default UserList;
